import { useNavigate } from "react-router-dom";

function Homepage(){
    let navigate = useNavigate(); 

    const routeChange = () =>{ 
        let path = "createprescription"; 
        navigate(path);
      }

    return (
      <> 
      <h1> Mediset </h1>

      <p> Welcome to Mediset. </p>

      <button onClick={routeChange} > Create Prescription </button>

      <button> Use Prescription </button>

      </>
    );
  }

export default Homepage;
